It never fails: The Monday following a holiday someone in the house is sick 🤒🤧

Not gonna lie, it takes me a few minutes of deep guttural eye rolls to not just want to throw my hands in the air & cry because my work day is now wonky with kids home 🙄

I told Dj this weekend how I was so looking forward to everyone having a full week of school, jokes on me 🤪

BUT! There are few things I do, without fail that really help shift my mindset and set my home up for the days home with sick little ones

These few things help my day to feel a bit more organized & motivating 🩵 

1. GET DRESSED - Seems silly when you have kids coughing/sneezing all over you but, do it.  Getting yourself ready first thing really helps you feel a bit more in control when your house feels everything but 

2. DISINFECT - Without fail, everything gets wiped down with my Thieves cleaner (handles, countertops etc) and Thieves is diffused all day to help eliminate those pesky germs 🦠 

3.  EMBRACE - what should truly be the number 1. the hardest thing of all.  I loathe sick season and it has taken me many years to get over the guilt associated with having sick kiddos home.  Worrying about missed days at school, what others may think etc.  The art of LETTING IT GO - and just worrying about what’s under your own roof is so important 

Last but certainly not least - increase your self care I have a few key things I implement into my day to really boost my immunity & hopefully keep me healthy so I can tend to my crew! 

@homesweethof for Thieves to diffuse & clean with 🫧
@better_daysco Greens Drink for the whole family & Hormones Drink for me 🥬 
@beekeepers_naturals Super B Honey 🍯 for the whole family 
@safeandfair Vitamin C for the whole family 🍊
@genexa for clean-homeopathic remedies that work! We LOVE their Cold Crush 🩵

Tell me; do you have any specific routines / habits that help you get through the days at home with sick kiddos?!
